def garnish(x, detail=0):
    # Reverse the bits of x, makes adjacent numbers more different
    # Inspired by https://en.wikipedia.org/wiki/Van_der_Corput_sequence
    v = hash(x)
    if x == -1:
        # hash(-1) == hash(-2) == -2 for some reason.
        # https://omairmajid.com/posts/2021-07-16-why-is-hash-in-python/
        v = -1
   
    # https://stackoverflow.com/questions/664014/what-integer-hash-function-are-good-that-accepts-an-integer-hash-key
    # Further scramble so that adjacent numbers are less similar
    v = ((v >> 16) ^ v) * 0x45d9f3b
    v = ((v >> 16) ^ v) * 0x45d9f3b
    v = (v >> 16) ^ v
    
    if detail == FIRST_NAME:
        return first_names[v % len(first_names)]
    elif detail == FULL_NAME:
        first = first_names[v % len(first_names)]
        v //= len(first_names)
        last = last_names[v % len(last_names)]
        return f"{first} {last}"
    elif detail == SHORT_BIO:
        first = first_names[v % len(first_names)]
        v //= len(first_names)
        last = last_names[v % len(last_names)]
        v //= len(last_names)
        occupation = occupations[v % len(occupations)]
        def_article = "an" if occupation[0] in "aeiou" else "a"
        return f"{first} {last} is {def_article} {occupation}"
    elif detail == LONG_BIO:
        first = first_names[v % len(first_names)]
        v //= len(first_names)
        last = last_names[v % len(last_names)]
        v //= len(last_names)
        adj = adjectives[v % len(adjectives)]
        v //= len(adjectives)
        occupation = occupations[v % len(occupations)]
        def_article = "an" if adj[0] in "aeiou" else "a"
        return f"{first} {last} is {def_article} {adj} {occupation}"

print("\n".join([garnish(i, LONG_BIO) for i in range(-100, 100)]))
print(len(first_names), len(last_names), len(occupations), len(adjectives))
